package org.hnust.cn.entity;

public class SystemmanageEntity
{
	private int id;
	private String title;
	public SystemmanageEntity(int id, String title)
	{
		// TODO Auto-generated constructor stub
		this.id = id;
		this.title = title;
	}
	public int getId()
	{
		return id;
	}
	public void setId(int id)
	{
		this.id = id;
	}
	public String getTitle()
	{
		return title;
	}
	public void setTitle(String title)
	{
		this.title = title;
	}
	
	
}
